import React from 'react';
import styled from 'styled-components';
import dynamic from 'next/dynamic'
import Head from 'next/head'
import { createGlobalStyle } from 'styled-components'

const GlobalStyle = createGlobalStyle`
  body {
    margin: 0;
    padding: 0;
  }
`

const SommWidget = dynamic(() => import('../components/SommWidget'), {
  ssr: false
})

const DemoWrapper = styled.div`
  width: 100vw;
  heght: 100%;
  overflow: hidden;

  body {
    padding: 0;
    margin: 0;
  }
`;

const IFrameWrapper = styled.div`
  width: 100vw;
  height: 100%;
  min-height: 100vh;
  display: flex;

  & iframe {
    width: 100%;
    height: 100%;
    min-height: 100vh;
  }
`;

const XOHDemo = ({}) => (
  <DemoWrapper>
    <GlobalStyle />
    <Head>
      <meta
        name="viewport"
        content="minimum-scale=1, initial-scale=1, width=device-width, shrink-to-fit=no"
      />
    </Head>
    <IFrameWrapper>
      <iframe src="https://xoh.ca" frameBorder="0"></iframe>
    </IFrameWrapper>
    <SommWidget username="xoh" iconColor="#f94343" backgroundColor="#fff" position="right" message="Check out our menu ðŸ‘‡"/>
  </DemoWrapper>
);

export default XOHDemo;
